        $batchSize = 20;
        $i = 1;
        foreach ($dados as $key => $value):            
            
            $sp = new Sp(); 
            $sp->setId($value[0]);
            $sp->setCidade(utf8_decode($value[1]));
            $sp->setLogradouro(utf8_decode($value[2]));
            $sp->setBairro(utf8_decode($value[3]));
            $sp->setCep($value[4]);
            $sp->setTipoLogradouro(utf8_decode($value[5]));
            
            $manager->persist($sp);
            if (($i % $batchSize) === 0) {
                $size = new Size();
                echo 'Flushing batch...' . "\n";
                echo 'Memory: ' . $size->getReadableSize(memory_get_usage()) . "\n";

                $manager->flush();
                $manager->clear();

                echo 'After batch...' . "\n";
                echo 'Memory: ' . $size->getReadableSize(memory_get_usage()) . "\n"; 
                unset($size);
            }            
            $i++;
            unset($sp);
            
        endforeach;        

        $manager->flush(); 
        $manager->clear();   	        
